var task_pages = []
function make_n_tabs(n){
  var task_driver = []
  var chrome_options = new chrome.Options()
  chrome_options.addArguments("--incognito")
  chrome_options.addArguments("--disable-infobars")
  // chrome_options.addArguments('--headless')
  chrome_options.addArguments('--window-size=1920,1080')
  chrome_options.addArguments("--user-agent=Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/105.0.0.0 Safari/537.36")
  chrome_options.addArguments('--start-maximized')
  var driver = new webdriver.Builder()
  .forBrowser('chrome')
  .setChromeOptions(chrome_options)
  .build()
  var ps = []
  for (var i = 0; i < n; i++) {
    ps.push(driver.executeScript('window.open("about:blank", "_blank")'))
  }
  var switcher;
  Promise.all(ps).then(function(){
    driver.getAllWindowHandles().then(
      function(e){
        task_driver = e
        switcher = driver.switchTo()
        console.log(task_driver)
      }
    ).then(function(){
      var task_index = 1
      driver.getWindowHandle().then(function(e){
        switcher.window(e).then(function cost(){
          var url;
          if (url = task_pages.shift()){
            driver.get(url).then(function(){
              switcher.window(task_driver[task_index++ % task_driver.length]).then(cost)
            })
          }else{
            setTimeout(cost, 10)
          }
        })
      })
    })
  })
  return driver
}
make_n_tabs(8)





setTimeout(function(){
  for (var i = 0; i < 13; i++) {
    task_pages.push('http://baidu.com')
  }
}, 2000)
